        [2949] = {7060120,"Divine - Azure Dragon's Rage","Uses skill to restore all ally Warriors' Anger by 1, and increases all allies' damage by 12% and all ally Warriors' CRIT DMG by 8%, lasting 1 round. Inflicts an Azure Dragon mark on 2 targets with the least Anger, lasting 1 round. Azure Dragon mark restores the warrior's Anger by 1 before the action starts",},
