        [2952] = {7060420,"Divine - Azure Dragon's Rage","Releases Skill to restore all ally Warriors' Anger by 1. Damage dealt by all allies increases by 12%, Hit Rate increases by 12%, CRIT Rate increases by 12% and CRIT DMG increases by 20%, lasting 1 round. Inflicts one Azure Dragon mark on 3 targets with the lowest Anger, lasting 1 round. Azure Dragon mark will restore the target's Anger by 2 before he/she acts",},
        [2953] = {7060520,"Divine - Azure Dragon's Rage","Releases Skill to restore all ally Warriors' Anger by 1. Damage dealt by all allies increases by 12%, Hit Rate increases by 12%, CRIT Rate increases by 12% and CRIT DMG increases by 24%, lasting 1 round. Inflicts one Azure Dragon mark on 3 targets with the lowest Anger, lasting 2 rounds. Azure Dragon mark will restore the target's Anger by 2 before he/she acts",},
